column79:
This concerns the proposed grant of three offshore transmission licences to successful bidders to connect three offshore wind farms to the GB onshore grid.

TR10 consists of Dogger Bank Offshore Wind Farm Phase 1, Moray West Offshore Wind Farm and Neart na Gaoithe Offshore Wind Farm (the Projects).

The tender process will consist of two stages for each Project: an Enhanced Pre-Qualification (EPQ) stage and an Invitation to Tender (ITT) stage, resulting in selection of preferred bidders.

Any bidder wishing to participate in the EPQ stage for any Project must express their interest as per the requirements in the EPQ documentation.

Additional information: 
TR10 consists of Dogger Bank A Wind Farm Phase 1, Moray West Offshore Wind Farm and Neart na Gaoithe Offshore Wind Farm (the Projects).

The tender process will consist of two stages for each of the Projects: an Enhanced Pre-Qualification (EPQ) stage followed by an Invitation to Tender (ITT) stage which will result in the selection of a preferred bidder. 

Any bidder wishing to participate in the EPQ stage for any or all of the Projects must express interest in doing so in accordance with the requirements in the EPQ documentation. 

The type of procedure to be adopted is a competitive procedure with negotiation. The subject matter of this notice is the proposed grant of three offshore transmission licences to successful bidders for the purpose of connecting three offshore wind farms to the GB onshore grid. 

TR10 consists of three projects. A transmission licence is expected to be granted for each project. High level details about the projects are as follows: 

Project: Dogger Bank A Offshore Wind Farm Phase 1; 
Developer: SSE Renewables, Equinor and Vårgrønn; 
Limited Capacity (MW): 1200; 
Location: 131km from the North East coast of England. 

Project: Neart na Gaoithe Offshore Wind Farm; 
Developer: EDF Renewables UK and ESB; 
Limited Capacity (MW): 450; 
Location: 15.5km off the Fife coast of Scotland. 

Project: Moray West Offshore Wind Farm; 
Developer: Ocean Winds  (a joint-venture between EDP Renewables and ENGIE) and Ignitis; 
Limited Capacity (MW): 860; 
Location: 65km north off the Aberdeenshire coast of Scotland. 


Requests to participate/EPQ submissions must be made electronically by 12:00 (local time), 11/04/2023 See the above links for how to do this.

Please note that the information contained in the fields &apos;contract start date&apos;; &apos;Contract end date&apos;, &apos;Lowest/actual value (£)&apos; in section 1 of this notice are indicative only. Please consult the tender documentation for further details.
